#[test]
fn to_sprs_1() {
    let a = rsparse::data::Trpl {
        // make simple diagonal matrix
        m: 3,
        n: 3,
        p: vec![0, 1, 2],
        i: vec![0, 1, 2],
        x: vec![2., 3., 4.],
    };
    let mut b = rsparse::data::Sprs::new();
    b.from_trpl(&a);
    let c = a.to_sprs();

    assert_eq!(b.nzmax, c.nzmax);
    assert_eq!(b.m, c.m);
    assert_eq!(b.n, c.n);
    assert_eq!(b.p, c.p);
    assert_eq!(b.i, c.i);
    assert_eq!(b.x, c.x);
    assert_eq!(b.to_dense(), c.to_dense());
    assert_eq!(
        b.to_dense(),
        [vec![2., 0., 0.], vec![0., 3., 0.], vec![0., 0., 4.]]
    );
}

