fn triplet_append_1() {
    let mut a = rsparse::data::Trpl {
        m: 3,
        n: 4,
        p: vec![0, 1, 2, 0, 3, 3],
        i: vec![0, 1, 2, 1, 2, 2],
        x: vec![2., 3., 4., 5., 6., 7.],
    };
    a.append(2, 0, 8.);
    a.sum_dupl();

    let mut b = rsparse::data::Sprs::new();
    b.from_trpl(&a);

    assert_eq!(
        b.to_dense(),
        vec![
            vec![2., 0., 0., 0.],
            vec![5., 3., 0., 0.],
            vec![8., 0., 4., 13.]
        ]
    );
    assert_eq!(b.m, 3);
    assert_eq!(b.n, 4);
}

