#[test]
fn multiply_1() {
    let a = [vec![0., 0., 2.], vec![1., 0., 0.], vec![9., 9., 9.]];
    let mut a_sparse = rsparse::data::Sprs::new();
    a_sparse.from_vec(&a[..]);

    let b = [vec![0., 0., 2.], vec![1., 0., 0.], vec![9., 1., 9.]];
    let mut b_sparse = rsparse::data::Sprs::new();
    b_sparse.from_vec(&b[..]);

    let c = rsparse::multiply(&a_sparse, &b_sparse);

    assert_eq!(
        c.to_dense(),
        vec![vec![18., 2., 18.], vec![0., 0., 2.], vec![90., 9., 99.]]
    )
}

#[test]
fn multiply_2() {
    let a = [vec![1., 1., 3.], vec![5., 0., 0.], vec![2., 2., 0.]];
    let mut a_sparse = rsparse::data::Sprs::new();
    a_sparse.from_vec(&a[..]);

    let b = [vec![1., 0., 0.], vec![0., 1., 0.], vec![0., 0., 1.]];
    let mut b_sparse = rsparse::data::Sprs::new();
    b_sparse.from_vec(&b[..]);

    let c = rsparse::multiply(&a_sparse, &b_sparse);

    // Check data
    assert_eq!(c.x, vec![1., 5., 2., 1., 2., 3.]);
    // Check indices
    assert_eq!(c.i, vec![0, 1, 2, 0, 2, 0]);
    // Check indptr
    assert_eq!(c.p, vec![0, 3, 5, 6]);
}

