#[test]
fn ops_order_1() {
    let a = [
        vec![2., 2., 4., 4., 1.],
        vec![3., 4., 5., 8., 3.],
        vec![2., 6., 3., 9., 3.],
        vec![5., 7., 6., 7., 1.],
        vec![7., 1., 8., 9., 2.],
    ];
    let mut a_sparse = rsparse::data::Sprs::new();
    a_sparse.from_vec(&a[..]);

    let b = [
        vec![8., 8., 6., 6., 2.],
        vec![4., 9., 7., 5., 9.],
        vec![2., 3., 8., 4., 1.],
        vec![4., 7., 6., 8., 9.],
        vec![9., 1., 8., 7., 1.],
    ];
    let mut b_sparse = rsparse::data::Sprs::new();
    b_sparse.from_vec(&b[..]);

    // Generate ground truth
    let r_sparse_add = rsparse::add(&a_sparse, &b_sparse, 1., 1.);
    let r_add = r_sparse_add.to_dense();
    let r_sparse_sub = rsparse::add(&a_sparse, &b_sparse, 1., -1.);
    let r_sub = r_sparse_sub.to_dense();
    let r_sparse_mul = rsparse::multiply(&a_sparse, &b_sparse);
    let r_mul = r_sparse_mul.to_dense();

    // Check add sparse vs sparse
    assert_eq!((&a_sparse + &b_sparse).x, r_sparse_add.x);
    assert_eq!((a_sparse.clone() + &b_sparse).i, r_sparse_add.i);
    assert_eq!((&a_sparse + b_sparse.clone()).p, r_sparse_add.p);

    // Check add as dense
    assert_eq!((&a_sparse + &b_sparse).to_dense(), r_add);
    assert_eq!((a_sparse.clone() + &b_sparse).to_dense(), r_add);
    assert_eq!((&a_sparse + b_sparse.clone()).to_dense(), r_add);
    assert_eq!((a_sparse.clone() + b_sparse.clone()).to_dense(), r_add);

    // Check sub sparse vs sparse
    assert_eq!((&a_sparse - &b_sparse).x, r_sparse_sub.x);
    assert_eq!((a_sparse.clone() - &b_sparse).i, r_sparse_sub.i);
    assert_eq!((&a_sparse - b_sparse.clone()).p, r_sparse_sub.p);

    // Check sub as dense
    assert_eq!((&a_sparse - &b_sparse).to_dense(), r_sub);
    assert_eq!((a_sparse.clone() - &b_sparse).to_dense(), r_sub);
    assert_eq!((&a_sparse - b_sparse.clone()).to_dense(), r_sub);
    assert_eq!((a_sparse.clone() - b_sparse.clone()).to_dense(), r_sub);

    // Check mul sparse vs sparse
    assert_eq!((&a_sparse * &b_sparse).x, r_sparse_mul.x);
    assert_eq!((a_sparse.clone() * &b_sparse).i, r_sparse_mul.i);
    assert_eq!((&a_sparse * b_sparse.clone()).p, r_sparse_mul.p);

    // Check mul as dense
    assert_eq!((&a_sparse * &b_sparse).to_dense(), r_mul);
    assert_eq!((a_sparse.clone() * &b_sparse).to_dense(), r_mul);
    assert_eq!((&a_sparse * b_sparse.clone()).to_dense(), r_mul);
    assert_eq!((a_sparse.clone() * b_sparse.clone()).to_dense(), r_mul);
}

